(529, '<blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><p dir=\"RTL\" style=\"text-align: center; margin: 0in 82.45pt 2pt 0in;\"><b><u><span style=\"font-size:\r\n14.0pt\">البند الحادى عشر</span></u></b></p></blockquote>\r\n\r\n<p dir=\"RTL\" style=\"margin-right:-1.15pt\"><span style=\"font-size:14.0pt;\">حرر هذا العقد\r\nمن نسختين أصليتين بيد كل طرف نسخة  و\r\nالنسخه مكونه من ثلاث ورقات للعمل بها عند الحاجة.<o:p></o:p></span></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-right:-1.15pt\"><span lang=\"AR-SA\" style=\"font-size:14.0pt;\"><o:p> </o:p></span></p>', '1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,4,5,13,1,', 29),
